<?php
session_start();
$_SESSION['captcha_success'] = "";
$output_text = "";

if(isset($_POST['vercode']))
{
	if(md5($_POST['versign']) != $_SESSION['versign']) 
	{
		$_SESSION['key'] = "";
		$_SESSION['versign'] = "";
		$_SESSION['captcha_success'] = "";
		//Error with configuration of Captcha
	}
	else 
	{
		if(md5($_POST['vercode']) != $_SESSION['key'])
		{
			$_SESSION['key'] = "";
			$_SESSION['versign'] = "";
			$_SESSION['captcha_success'] = "no";
		}
		else
		{
			$_SESSION['key'] = "";
			$_SESSION['versign'] = "";
			$_SESSION['captcha_success'] = "yes";
		}
	}
}

$md5 = md5(microtime() * time());
$string = substr($md5,0,6);

$bg_rand = rand(1, 2);
$bg1 = "data:image/png;base64,";
$bg2 = "data:image/png;base64,";
$array = array($bg1, $bg2);

$captcha = imagecreatefrompng($array[rand(0, count($array) - 1)]);
$text = imagecolorallocate($captcha, 0, 0, 0); 
$line = imagecolorallocate($captcha,233,239,239); 
imageline($captcha,0,0,39,29,$line);
imageline($captcha,40,0,64,29,$line);
imagestring($captcha, 10, 22, 8, $string, $text); 
	
$_SESSION['key'] = md5($string); 
$_SESSION['versign'] = md5("php_captcha");

ob_start();
imagepng($captcha);
$captchaImage = ob_get_contents();
ob_end_clean();
imagedestroy($captcha);
$base64 = 'data:image/png;base64,' . base64_encode($captchaImage);

echo '<div style="border:2px solid #000; width:100px;">';
echo '<img src="'.$base64.'" alt="Captcha Image" />';
echo '<br /><input type="text" style="width:96px;" name="vercode" id="vercode" />';
echo '<input name="versign" type="hidden" value="php_captcha" />';
echo '</div>';
?>
